import React from 'react';

const Pokemon = ({ pokemon }) => {

    const {name, image} = pokemon;

    return (
        <li>
            <h3>
                { name }
            </h3>
            <img src = {image} alt = "Pokemon Image" />
        </li>
    );
}
 
export default Pokemon;
